CREATE TABLE `tp_areas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `area_name` varchar(16) NOT NULL DEFAULT '' COMMENT '名称',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '父类id',
  `level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '等级',
  `route` varchar(64) NOT NULL DEFAULT '' COMMENT '路径',
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 comment='省市区县数据表';

